import React from 'react';
import AnimatedPulseIcon from './animated-pulse-icon';
import { CoffeeIcon } from '../icons/icons';

const AnimatedPulseCoffeeIcon = () => (
    <AnimatedPulseIcon>
        <CoffeeIcon />
    </AnimatedPulseIcon>
);

export default AnimatedPulseCoffeeIcon;
